[application]

name="Tanks of Freedom"
main_scene="res://game.xscn"
disable_stdout=false
use_shared_user_dir=true
icon="res://icon.png"
target_fps=30
boot_logo=img(rgb, 0, 512, 384, )
boot_bg_color=#ff000000

[debug]

print_fps=true
print_metrics=false

[display]

width=800
height=480
resizable=true
fullscreen=false
stretch_mode="disabled"
stretch_aspect="keep"

[image_loader]

filter=false
gen_mipmaps=false

[rasterizer]

trilinear_mipmap_filter=false
anisotropic_filter_level=1.0
use_pixel_snap=true

[render]

thread_model=2
mipmap_policy=0
shadows_enabled=false
default_clear_color=#ff2f484e
room_cull_enabled=false
light_discard_enabled=true
